import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Papa from "papaparse";

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function Home() {
  const [spots, setSpots] = useState([]);
  const [route, setRoute] = useState([]);
  const [weather, setWeather] = useState({});
  const [userPreferences, setUserPreferences] = useState({
    preferNature: true,  // User prefers nature spots
    preferCulture: false,  // User prefers culture spots
  });

  // Fetch and parse CSV data
  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csv) => {
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng) // Ensure spots have name, lat, and lng
              .map((r) => ({
                name: r.name.trim(),
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                visitors: r.visitors.trim() || "Moderate",
                image: r.image || null,
                description: r.description || "No description",
                type: r.tags || "nature",  // Assuming tags are stored as a string of comma-separated values
              }));
            setSpots(rows);
          },
        });
      })
      .catch((error) => {
        console.error("Error loading CSV:", error); // Log any errors in fetching CSV
      });
  }, []);

  // Dummy weather data (for demonstration purposes)
  useEffect(() => {
    setWeather({ weather: [{ main: "Clear" }] }); // Set a dummy clear weather for now
  }, []);

  // ML-like route generation (simplified scoring based on user preferences)
  const generateRoute = () => {
    console.log("Generate Route Clicked!");

    if (!spots.length) {
      alert("Select at least one spot!");
      return;
    }

    // Start the scoring process
    let scoredSpots = spots.map((spot) => {
      let score = 0;
      
      // Preference scoring: Add points based on user preferences
      if (userPreferences.preferNature && spot.type.includes("nature")) {
        score += 0.3; // Nature spots are preferred
      }
      if (userPreferences.preferCulture && spot.type.includes("history")) {
        score += 0.2; // Cultural spots are also preferred
      }

      // Weather penalty: Penalize nature spots during bad weather
      if (weather.weather[0].main.toLowerCase().includes("rain") && spot.type.includes("nature")) {
        score -= 0.2; // Penalize nature spots during rain
      }

      // Visitor frequency: Higher visitors might be preferred or avoided
      const visitorRanking = { "Very High": 3, High: 2, Moderate: 1, Low: 0 };
      score += visitorRanking[spot.visitors] || 1;

      return { ...spot, score }; // Return the spot with its score
    });

    // Sort spots by score (highest first)
    scoredSpots.sort((a, b) => b.score - a.score);

    console.log("Generated Route:", scoredSpots); // Log the generated route

    // Set the route
    setRoute(scoredSpots);
  };

  return (
    <div style={{ display: "grid", gap: 16, gridTemplateColumns: "1fr 1fr" }}>
      <div className="card">
        <h2>Majayjay Overview</h2>
        <div className="map-wrap" style={{ height: "500px" }}>
          {spots.length > 0 ? (
            <MapContainer
              center={CENTER}
              zoom={13}
              style={{ height: "100%", width: "100%" }}
            >
              <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              />
              {route.length > 0
                ? route.map((s, i) => (
                    <Marker key={i} position={[s.lat, s.lng]}>
                      <Popup>
                        <strong>{s.name}</strong>
                        <br />
                        Visitors: {s.visitors}
                        {s.image && (
                          <>
                            <br />
                            <img
                              src={s.image}
                              alt={s.name}
                              style={{ width: "150px", borderRadius: "8px", marginTop: "4px" }}
                            />
                          </>
                        )}
                        <p>{s.description}</p>
                      </Popup>
                    </Marker>
                  ))
                : spots.map((s, i) => (
                    <Marker key={i} position={[s.lat, s.lng]}>
                      <Popup>
                        <strong>{s.name}</strong>
                        <br />
                        Visitors: {s.visitors}
                        {s.image && (
                          <>
                            <br />
                            <img
                              src={s.image}
                              alt={s.name}
                              style={{ width: "150px", borderRadius: "8px", marginTop: "4px" }}
                            />
                          </>
                        )}
                        <p>{s.description}</p>
                      </Popup>
                    </Marker>
                  ))}
            </MapContainer>
          ) : (
            <div>No spots available to display</div>
          )}
        </div>
      </div>

      <div className="card">
        <h2>Most Visited Places</h2>
        <ul style={{ margin: 0, paddingLeft: 18 }}>
          {spots.length > 0 ? (
            spots.map((s, i) => (
              <li key={i}>
                <strong>{s.name}</strong> â€” {s.visitors} visitors
              </li>
            ))
          ) : (
            <li>No spots found in CSV</li>
          )}
        </ul>
        <button onClick={generateRoute}>Generate Route</button>
      </div>
    </div>
  );
}
